	'messages:config-welcome' => 'de:MediaWiki ist ein freies und quelloffenes Wiki-Softwarepaket, das in PHP geschrieben ist. Es dient als Plattform für Wikipedia und die anderen Wikimedia-Projekte, die jeden Monat von Hunderten von Millionen Menschen genutzt werden. MediaWiki ist in über 350 Sprachen lokalisiert, und seine Zuverlässigkeit und sein robuster Funktionsumfang haben ihm eine große und lebendige Gemeinschaft von Drittanwendern und -entwicklern eingebracht.

