	'messages:config-no-cli-uploads-check' => 'de:\'\'\'Warnung\'\'\': Das Standardverzeichnis für hochgeladene Dateien (<code>$1</code>) wird, während der Installation über die Kommandozeile, nicht auf Sicherheitsanfälligkeiten hinsichtlich willkürlicher Skriptausführungen geprüft.',
	'messages:config-using-32bit' => 'de:<strong>Warnung:</strong> Es scheint, als ob dein System mit 32-Bit-Ganzzahlen läuft. Dies wird [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:32-bit nicht empfohlen].',
	'messages:config-db-host-help' => 'de:Wenn sich die Datenbank auf einem anderen Server befindet, ist hier der Servername oder die entsprechende IP-Adresse anzugeben.

Sofern ein gemeinschaftlich genutzter Server verwendet wird, sollte der Hoster den zutreffenden Servernamen in seiner Dokumentation angegeben haben.

Sofern MySQL genutzt wird, funktioniert der Servername „localhost“ voraussichtlich nicht. In diesem Fall sollte „127.0.0.1“ oder die lokale IP-Adresse angegeben werden.

Sofern PostgreSQL genutzt wird, muss dieses Feld leer gelassen werden, um über einen Unix-Socket zu verbinden.',
	'messages:config-db-name-help' => 'de:Bitte einen Namen angeben, mit dem das Wiki identifiziert werden kann.
Dabei sollten keine Leerzeichen verwendet werden.

Sofern ein gemeinschaftlich genutzter Server verwendet wird, sollte der Hoster den Datenbanknamen angegeben oder aber die Erstellung einer Datenbank über ein entsprechendes Interface gestattet haben.',
	'messages:config-db-wiki-help' => 'de:Bitte Benutzernamen und Passwort angeben, die der Webserver während des Normalbetriebes dazu verwenden soll, eine Verbindung zum Datenbankserver herzustellen.
Sofern ein entsprechendes Benutzerkonto nicht vorhanden ist und das Benutzerkonto für den Installationsvorgang über ausreichende Berechtigungen verfügt, wird dieses Benutzerkonto automatisch mit den Mindestberechtigungen zum Normalbetrieb des Wikis angelegt.',
	'messages:config-db-prefix-help' => 'de:Sofern eine Datenbank für mehrere Wikiinstallationen oder eine Wikiinstallation und eine andere Programminstallation genutzt werden soll, muss ein Datenbanktabellenpräfix angegeben werden, um Datenbankprobleme zu vermeiden.
Es können keine Leerzeichen verwendet werden.

Gewöhnlich bleibt dieses Feld leer.',
	'messages:config-mariadb-old' => 'de:MariaDB $1 oder höher ist erforderlich. Du hast $2.',
	'messages:config-db-ssl' => 'de:Verbindung über SSL',
	'messages:config-sqlite-dir-help' => 'de:SQLite speichert alle Daten in einer einzigen Datei.

Das für sie vorgesehene Verzeichnis muss während des Installationsvorgangs beschreibbar sein.

Es sollte \'\'\'nicht\'\'\' über das Web zugänglich sein, was der Grund ist, warum die Datei nicht dort abgelegt wird, wo sich die PHP-Dateien befinden.

Das Installationsprogramm wird mit der Datei zusammen eine zusätzliche <code>.htaccess</code>-Datei erstellen. Sofern dies scheitert, können Dritte auf die Datendatei zugreifen.
Dies umfasst die Nutzerdaten (E-Mail-Adressen, Passwörter, etc.) wie auch gelöschte Seitenversionen und andere vertrauliche Daten, die im Wiki gespeichert sind.

Es ist daher zu erwägen, die Datendatei an gänzlich anderer Stelle abzulegen, beispielsweise im Verzeichnis <code>./var/lib/mediawiki/yourwiki</code>.',
	'messages:config-support-info' => 'de:MediaWiki unterstützt die folgenden Datenbanksysteme:

$1

Sofern unterhalb nicht das Datenbanksystem angezeigt wird, das verwendet werden soll, muss dieses noch verfügbar gemacht werden. Oben ist zu jedem unterstützten Datenbanksystem ein Link zur entsprechenden Anleitung vorhanden.',
	'messages:config-dbsupport-sqlite' => 'de:* [{{int:version-db-sqlite-url}} SQLite] ist ein verschlanktes Datenbanksystem, das auch gut unterstützt wird ([https://www.php.net/manual/de/pdo.installation.php Anleitung zur Kompilierung von PHP mit SQLite-Unterstützung], verwendet PHP Data Objects (PDO))',
	'messages:config-sqlite-parent-unwritable-group' => 'de:Das Datenverzeichnis <code><nowiki>$1</nowiki></code> kann nicht erzeugt werden, da das übergeordnete Verzeichnis <code><nowiki>$2</nowiki></code> nicht für den Webserver beschreibbar ist.

Das Installationsprogramm konnte den Benutzer bestimmen, mit dem der Webserver ausgeführt wird.
Schreibzugriff auf das <code><nowiki>$3</nowiki></code>-Verzeichnis muss für diesen ermöglicht werden, um den Installationsvorgang fortsetzen zu können.

Auf einem Unix- oder Linux-System:
<pre>cd $2
mkdir $3
chgrp $4 $3
chmod g+w $3</pre>',
	'messages:config-sqlite-parent-unwritable-nogroup' => 'de:Das Datenverzeichnis <code><nowiki>$1</nowiki></code> kann nicht erzeugt werden, da das übergeordnete Verzeichnis <code><nowiki>$2</nowiki></code> nicht für den Webserver beschreibbar ist.

Das Installationsprogramm konnte den Benutzer bestimmen, mit dem der Webserver ausgeführt wird.
Schreibzugriff auf das <code><nowiki>$3</nowiki></code>-Verzeichnis muss global für diesen und andere Benutzer ermöglicht werden, um den Installationsvorgang fortsetzen zu können.

Auf einem Unix- oder Linux-System:
<pre>cd $2
mkdir $3
chmod a+w $3</pre>',
	'messages:config-upgrade-error' => 'de:Bei der Aktualisierung der MediaWiki-Tabellen in deiner Datenbank gab es einen Fehler.

Für weitere Informationen siehe bitte in das oben stehende Logbuch. Um es erneut zu versuchen, klicke auf <strong>Fortfahren</strong>.',
	'messages:config-upgrade-done' => 'de:Die Aktualisierung ist nun abgeschlossen.

Das Wiki kann nun [$1 genutzt werden].

Sofern die Datei <code>LocalSettings.php</code> neu erzeugt werden soll, bitte auf die Schaltfläche unten klicken.
Dies wird \'\'\'nicht empfohlen\'\'\', es sei denn, es treten Probleme mit dem Wiki auf.',
	'messages:config-mysql-engine-help' => 'de:<strong>InnoDB</strong> als Speichersubsystem für das Datenbanksystem MySQL ist fast immer die bessere Wahl, da es gleichzeitige Zugriffe gut unterstützt.

<strong>MyISAM</strong> als Speichersubsystem für das Datenbanksystem MySQL ist hingegen in Einzelnutzerumgebungen oder bei schreibgeschützten Wikis schneller.
Datenbanken, die MyISAM verwenden, sind indes tendenziell fehleranfälliger als solche, die InnoDB verwenden.',
	'messages:config-server' => 'de:URL-Hostname:',
	'messages:config-server-help' => 'de:Der Teil des Protokolls und des Hostnamens der URL, der für den Zugriff auf das Wiki verwendet wird. Der automatisch ermittelte Standard ist in der Regel korrekt.',
	'messages:config-project-namespace-help' => 'de:Dem Beispiel von Wikipedia folgend, unterscheiden viele Wikis zwischen den Seiten für Inhalte und denen für Richtlinien. Letztere werden im \'\'\'Projektnamensraum\'\'\' hinterlegt.
Alle Seiten dieses Namensraumes verfügen über ein Seitenpräfix, das nun an dieser Stelle angegeben werden kann.
Normalerweise steht dieses Seitenpräfix mit dem Namen des Wikis in einem engen Zusammenhang. Dabei können bestimmte Sonderzeichen wie „#“ oder „:“ nicht verwendet werden.',
	'messages:config-admin-error-password-invalid' => 'de:Ungültiges Administrator-Passwort für das Wiki: $1',
	'messages:config-subscribe-help' => 'de:Es handelt sich hierbei um eine Mailingliste mit wenigen Aussendungen, die für Mitteilungen zu Versionsveröffentlichungen, einschließlich wichtiger Sicherheitsveröffentlichungen, genutzt wird.
Diese Mailingliste sollte abonniert werden. Zudem sollte die MediaWiki-Installation stets aktualisiert werden, sobald eine neue Programmversion veröffentlicht wurde.',
	'messages:config-subscribe-noemail' => 'de:Beim Abonnieren der Mailingliste mit Mitteilungen zu Versionsveröffentlichungen wurde keine E-Mail-Adresse angegeben.
Bitte eine E-Mail-Adresse angeben, sofern die Mailingliste abonniert werden soll.',
	'messages:config-pingback' => 'de:Daten über diese Installation mit den MediaWiki-Entwicklern teilen. [https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement Datenschutz].',
	'messages:config-pingback-help' => 'de:Sofern diese Option ausgewählt wird, meldet MediaWiki regelmäßig die Basisdaten dieser MediaWiki-Installation an https://www.mediawiki.org. Diese Daten enthalten beispielsweise den Betriebssystemtyp, die PHP-Version sowie das genutzte Datenbanksystem. Die Wikimedia Foundation teilt diese Daten mit den MediaWiki-Entwicklern, um Entscheidungen zur künftigen Softwareentwicklung zu verbessern. Die folgenden Daten werden für diese Installation gesendet:
<pre>$1</pre>

Die Datenschutzbestimmungen für diese Funktion können unter https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement eingesehen werden.

Weitere allgemeine Informationen über diese Funktion findest du unter https://www.mediawiki.org/wiki/Special:MyLanguageManual:$wgPingback.

Für aggregierte Pingback-Daten siehe https://pingback.wmflabs.org.',
	'messages:config-profile-help' => 'de:Wikis sind am nützlichsten, wenn so viele Menschen wie möglich Bearbeitungen vornehmen können.
Mit MediaWiki ist es einfach, die letzten Änderungen nachzuvollziehen und unbrauchbare Bearbeitungen, beispielsweise von unbedarften oder böswilligen Benutzern, rückgängig zu machen.

Allerdings finden etliche Menschen Wikis auch mit anderen Bearbeitungskonzepten sinnvoll. Manchmal ist es zudem nicht einfach, alle Beteiligten von den Vorteilen des „Wiki-Prinzips” zu überzeugen. Darum ist diese Auswahl möglich.

Das Modell „\'\'\'{{int:config-profile-wiki}}\'\'\'“ ermöglicht es jedermann, sogar ohne über ein Benutzerkonto zu verfügen, Bearbeitungen vorzunehmen.
Ein Wiki bei dem die \'\'\'{{int:config-profile-no-anon}}\'\'\' ist, fordert von den Benutzern eine höhere Verantwortung für ihre Bearbeitungen ein, könnte allerdings Personen abschrecken, die nur gelegentlich Bearbeitungen vornehmen wollen. Ein Wiki für \'\'\'{{int:config-profile-fishbowl}}\'\'\' gestattet es nur bestimmten Benutzern, Bearbeitungen vorzunehmen. Allerdings kann dabei die Allgemeinheit die Seiten immer noch betrachten und Änderungen nachvollziehen. Ein \'\'\'{{int:config-profile-private}}\'\'\' gestattet es nur ausgewählten Benutzern, Seiten zu betrachten sowie zu bearbeiten.

Komplexere Konzepte zur Zugriffssteuerung können erst nach abgeschlossenem Installationsvorgang eingerichtet werden. Hierzu gibt es weitere Informationen auf der Website mit der [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights entsprechenden Anleitung].',
	'messages:config-license-help' => 'de:Viele öffentliche Wikis publizieren alle Beiträge unter einer [https://freedomdefined.org/Definition/De freien Lizenz.]
Dies trägt dazu bei, ein Gefühl von Gemeinschaft zu schaffen, und ermutigt zu längerfristiger Mitarbeit.
Hingegen ist im Allgemeinen eine freie Lizenz auf geschlossenen Wikis nicht notwendig.

Sofern man Texte aus der Wikipedia verwenden möchte und umgekehrt, sollte die Lizenz {{int:config-license-cc-by-sa}} gewählt werden.

Die Wikipedia nutzte vormals die GNU-Lizenz für freie Dokumentation (GFDL).
Die GFDL ist eine gültige Lizenz, die allerdings schwer zu verstehen ist.
Es ist zudem schwierig, gemäß dieser Lizenz lizenzierte Inhalte wiederzuverwenden.',
	'messages:config-email-auth-help' => 'de:Sofern diese Funktion aktiviert ist, müssen Benutzer ihre E-Mail-Adresse bestätigen, indem sie den Bestätigungslink nutzen, der ihnen immer dann zugesandt wird, wenn sie ihre E-Mail-Adresse angeben oder ändern.
Nur bestätigte E-Mail-Adressen können Nachrichten von anderen Benutzer oder Benachrichtigungsmitteilungen erhalten.
Die Aktivierung dieser Funktion wird bei offenen Wikis, mit Hinblick auf möglichen Missbrauch der E-Mail-Funktionen, \'\'\'empfohlen.\'\'\'',
	'messages:config-email-sender-help' => 'de:Bitte hier die E-Mail-Adresse angeben, die als Absenderadresse bei ausgehenden E-Mails eingesetzt werden soll.
Rücklaufende E-Mails werden an diese E-Mail-Adresse gesandt.
Bei vielen E-Mail-Servern muss der Teil der E-Mail-Adresse mit der Domainangabe korrekt sein.',
	'messages:config-upload-help' => 'de:Das Hochladen von Dateien macht den Server für potentielle Sicherheitsprobleme anfällig.
Weitere Informationen hierzu können im [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security Abschnitt Sicherheit] der Anleitung nachgelesen werden.

Um das Hochladen von Dateien zu ermöglichen, muss der Zugriff auf das Unterverzeichnis <code>./images</code> so geändert werden, dass dieses für den Webserver beschreibbar ist.
Hernach kann diese Option aktiviert werden.',
	'messages:config-personalization-settings' => 'de:Personalisierung',
	'messages:config-logo-summary' => 'de:Für jedes dieser Felder musst du ein Bild in der entsprechenden Größe hochladen und die URL in die unten stehenden Felder eingeben. Du kannst  <code>$wgStylePath</code> oder <code>$wgScriptPath</code> verwenden, wenn dein Logo relativ zu diesen Pfaden abgelegt ist. Du kannst jedes dieser Felder leer lassen.',
	'messages:config-logo-preview-main' => 'de:Hauptseite',
	'messages:config-logo-icon' => 'de:Logo (Icon):',
	'messages:config-logo-icon-help' => 'de:Dein Logo-Symbol sollte quadratisch und idealerweise größer als 50 Pixel oder ein SVG sein.',
	'messages:config-logo-wordmark' => 'de:Wortmarke (optional):',
	'messages:config-logo-wordmark-help' => 'de:Der Name deiner Webseite. Wenn nicht definiert, wird in der Regel auf Text zurückgegriffen. Idealerweise ein SVG mit einer Höhe von 30 Pixel oder weniger.',
	'messages:config-logo-tagline' => 'de:Tagline (optional):',
	'messages:config-logo-tagline-help' => 'de:Der Slogan deiner Website. Nur verwenden, wenn du oben eine Wortmarke definiert hast. Wenn du keine Wortmarke definiert hast, wird diese in der Regel in Text umgewandelt. Die kombinierte Höhe von Slogan und Wortmarke sollte in der Regel 50 Pixel nicht überschreiten.',
	'messages:config-logo-sidebar' => 'de:Logo in der Seitenleiste (optional):',
	'messages:config-logo-filedrop' => 'de:Hier eine Bilddatei ablegen',
	'messages:config-logo-sidebar-help' => 'de:Einige MediaWiki-Skins enthalten ein Logo mit 160 Pixel Höhe als Teil des Seitenleistenmenüs. Wenn es nicht definiert ist, ist es dasselbe wie das oben definierte Symbol. Vielleicht möchtest du eine eigene Grafik haben, die Wortmarke und Icon kombiniert.',
	'messages:config-instantcommons-help' => 'de:[https://www.mediawiki.org/wiki/Special:MyLanguage/InstantCommons InstantCommons] ist eine Funktion, die es Wikis ermöglicht, Bild-, Klang- und andere Mediendateien zu nutzen, die auf der Website [https://commons.wikimedia.org/ Wikimedia Commons] verfügbar sind.
Um diese Funktion nutzen zu können, muss das Wiki über eine Verbindung zum Internet verfügen.

Weitere Informationen zu dieser Funktion, einschließlich der Anleitung, wie hierfür andere Wikis als Wikimedia Commons eingerichtet werden können, gibt es im [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgForeignFileRepos Handbuch].',
	'messages:config-cache-help' => 'de:Das Objektcaching wird dazu genutzt, die Geschwindigkeit von MediaWiki zu verbessern, indem häufig genutzte Daten zwischengespeichert werden.
Es wird sehr empfohlen, es für mittelgroße bis große Wikis zu nutzen, aber auch für kleine Wikis ergeben sich erkennbare Geschwindigkeitsverbesserungen.',
	'messages:config-skins' => 'de:Benutzeroberflächen',
	'messages:config-skins-help' => 'de:Die oben aufgeführten Benutzeroberflächen wurden im Verzeichnis <code>./skins</code> gefunden. Du musst mindestens eine aktivieren und als Standard auswählen.',
	'messages:config-skins-use-as-default' => 'de:Diese Benutzeroberfläche als Standard verwenden',
	'messages:config-skins-missing' => 'de:Es wurden keine Benutzeroberflächen gefunden. MediaWiki wird eine Fallback-Benutzeroberfläche verwenden, bis du andere Benutzeroberflächen installierst.',
	'messages:config-skins-must-enable-some' => 'de:Du musst mindestens eine zu aktivierende Benutzeroberfläche auswählen.',
	'messages:config-skins-must-enable-default' => 'de:Die ausgewählte Standard-Benutzeroberfläche muss aktiviert sein.',
	'messages:config-pg-not-in-role' => 'de:Das für den Webbenutzer angegebene Benutzerkonto ist bereits vorhanden.
Das für den Installationsvorgang angegebene Benutzerkonto ist kein Superbenutzer und nicht Mitglied der Benutzergruppe der Webbenutzer, so dass keine dem Webbenutzer zugeordneten Datenobjekte erstellt werden können.

Für MediaWiki ist es momentan erforderlich, dass die Tabellen dem Webbenutzer rechtemäßig zugeordnet sind. Bitte einen anderen Namen für den Webbenutzer angeben oder „← Zurück“ anklicken, um einen ausreichend berechtigten Benutzer für den Installationsvorgang anzugeben.',
