	'messages:config-install-subscribe-alreadypending' => 'de:Eine Anfrage zum Abonnieren von mediawiki-announce wurde bereits gestellt. Bitte antworte auf die Bestätigungs-E-Mail, die zuvor gesendet wurde.',
	'messages:config-install-subscribe-possiblefail' => 'de:Deine Anfrage, mediawiki-announce zu abonnieren, ist möglicherweise nicht erfolgreich gewesen. Wenn du nicht innerhalb weniger Minuten eine Bestätigungs-E-Mail erhältst, gehe zu [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ lists.wikimedia.org] und versuche erneut, deine Anfrage zu übermitteln.',
