	'messages:apihelp-compare-param-toslots' => 'en:Override content of the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var>.

This parameter specifies the slots that are to be modified. Use <var>totext-&#x7B;slot}</var>, <var>tocontentmodel-&#x7B;slot}</var>, and <var>tocontentformat-&#x7B;slot}</var> to specify content for each slot.',
	'messages:apihelp-parse-extended-description' => 'en:See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.

There are several ways to specify the text to parse:
# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.
# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, <var>$1revid</var>, and <var>$1contentmodel</var>.
# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.',
	'messages:apihelp-parse-param-usearticle' => 'en:Use the ArticleParserOptions hook to ensure the options used match those used for article page views',
	'messages:apihelp-query+alldeletedrevisions-param-miser-user-namespace' => 'en:<strong>Note:</strong> Due to [[mw:Special:MyLanguage/Manual:$wgMiserMode|miser mode]], using <var>$1user</var> and <var>$1namespace</var> together may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.',
	'messages:apihelp-query+categorymembers-param-title' => 'en:Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.',
	'messages:apihelp-query+filerepoinfo-paramvalue-prop-articlepath' => 'en:Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgArticlePath|$wgArticlePath]]</var> or equivalent.',
	'messages:apihelp-query+filerepoinfo-paramvalue-prop-server' => 'en:Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgServer|$wgServer]]</var> or equivalent.',
	'messages:apihelp-query+langlinks-example-simple' => 'en:Get interlanguage links from the page [[{{MediaWiki:Mainpage}}]].',
	'messages:apihelp-query+links-example-namespaces' => 'en:Get links from the page [[{{MediaWiki:Mainpage}}]] in the {{ns:user}} and {{ns:template}} namespaces.',
	'messages:apihelp-query+logevents-param-action' => 'en:Filter log actions to only this action. Overrides <var>$1type</var>. In the list of possible values, values with the asterisk wildcard such as <kbd>action/*</kbd> can have different strings after the slash (/).',
	'messages:apihelp-query+pageprops-param-prop' => 'en:Only list these page properties (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use). Useful for checking whether pages use a certain page property.',
	'messages:apihelp-query+pageprops-example-simple' => 'en:Get properties for the pages <kbd>{{MediaWiki:Mainpage}}</kbd> and <kbd>MediaWiki</kbd>.',
	'messages:apihelp-query+pageswithprop-param-propname' => 'en:Page property for which to enumerate pages (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use).',
	'messages:apihelp-query+prefixsearch-extended-description' => 'en:Despite the similarity in names, this module is not intended to be equivalent to [[Special:PrefixIndex]]; for that, see <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> with the <kbd>apprefix</kbd> parameter. The purpose of this module is similar to <kbd>[[Special:ApiHelp/opensearch|action=opensearch]]</kbd>: to take user input and provide the best-matching titles. Depending on the search engine backend, this might include typo correction, redirect avoidance, or other heuristics.',
	'messages:apihelp-query+random-extended-description' => 'en:Pages are listed in a fixed sequence, only the starting point is random. This means that if, for example, <samp>Main Page</samp> is the first random page in the list, <samp>List of fictional monkeys</samp> will <em>always</em> be second, <samp>List of people on stamps of Vanuatu</samp> third, etc.',
	'messages:apihelp-query+recentchanges-paramvalue-prop-userid' => 'en:Adds the user ID responsible for the edit. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.',
	'messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment' => 'en:Adds the parsed comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.',
	'messages:apihelp-query+revisions-extended-description' => 'en:May be used in several ways:
# Get data about a set of pages (last revision), by setting titles or pageids.
# Get revisions for one given page, by using titles or pageids with start, end, or limit.
# Get data about a set of revisions by setting their IDs with revids.',
	'messages:apihelp-query+revisions-example-content' => 'en:Get data with content for the last revision of titles <kbd>API</kbd> and [[{{MediaWiki:Mainpage}}]].',
	'messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment' => 'en:Parsed comment by the user for the revision. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.',
	'messages:apihelp-query+revisions+base-paramvalue-prop-parsetree' => 'en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. The XML parse tree of revision content (requires content model <code>$1</code>). For performance reasons, if this option is used, <var>$3limit</var> is enforced to $2.',
	'messages:apihelp-query+revisions+base-param-slots' => 'en:Which revision slots to return data for, when slot-related properties are included in <var>$1props</var>. If omitted, data from the <kbd>main</kbd> slot will be returned in a backwards-compatible format.',
	'messages:apihelp-query+revisions+base-param-limit' => 'en:Limit how many revisions will be returned. If <var>$3prop=content</var>, <var>$3prop=parsetree</var>, <var>$3diffto</var> or <var>$3difftotext</var> is used, the limit is $1. If <var>$3parse</var> is used, the limit is $2.',
	'messages:apihelp-query+revisions+base-param-expandtemplates' => 'en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> instead. Expand templates in revision content (requires $1prop=content).',
	'messages:apihelp-query+revisions+base-param-generatexml' => 'en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Generate XML parse tree for revision content (requires $1prop=content).',
	'messages:apihelp-query+revisions+base-param-parse' => 'en:Use <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Parse revision content (requires <var>$2prop=content</var>). For performance reasons, if this option is used, <var>$2limit</var> is enforced to $1.',
	'messages:apihelp-query+revisions+base-param-diffto' => 'en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively. For performance reasons, if this option is used, <var>$2limit</var> is enforced to $1.',
	'messages:apihelp-query+revisions+base-param-difftotext' => 'en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$2diffto</var>. If <var>$2section</var> is set, only that section will be diffed against this text. For performance reasons, if this option is used, <var>$2limit</var> is enforced to $1.',
	'messages:apihelp-query+revisions+base-param-difftotextpst' => 'en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.',
	'messages:apihelp-query+revisions+base-param-contentformat' => 'en:Serialization format used for <var>$1difftotext</var> and expected for output of content.',
	'messages:apihelp-query+siteinfo-paramvalue-prop-showhooks' => 'en:Returns a list of all subscribed hooks (contents of <var>[[mw:Special:MyLanguage/Manual:$wgHooks|$wgHooks]]</var>).',
	'messages:apihelp-query+templates-example-namespaces' => 'en:Get pages in the {{ns:user}} and {{ns:template}} namespaces that are transcluded on the page [[{{MediaWiki:Mainpage}}]].',
	'messages:apihelp-query+tokens-summary' => 'en:Gets tokens for data-modifying actions.',
	'messages:apihelp-query+transcludedin-param-show' => 'en:Show only items that meet these criteria:',
	'messages:apihelp-query+transcludedin-paramvalue-show-!redirect' => 'en:Only show non-redirects.',
	'messages:apihelp-query+transcludedin-example-simple' => 'en:Get a list of pages transcluding [[{{MediaWiki:Mainpage}}]].',
	'messages:apihelp-query+transcludedin-example-generator' => 'en:Get information about pages transcluding [[{{MediaWiki:Mainpage}}]].',
	'messages:apihelp-query+usercontribs-param-namespace' => 'en:Only list contributions in these namespaces.',
	'messages:apihelp-query+usercontribs-param-prop' => 'en:Include additional pieces of information:',
	'messages:apihelp-query+usercontribs-paramvalue-prop-title' => 'en:Adds the title and namespace ID of the page.',
	'messages:apihelp-query+usercontribs-paramvalue-prop-parsedcomment' => 'en:Adds the parsed comment of the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.',
	'messages:apihelp-query+usercontribs-paramvalue-prop-sizediff' => 'en:Adds the size delta of the edit against its parent.',
	'messages:apihelp-query+usercontribs-param-show' => 'en:Show only items that meet these criteria, e.g. non minor edits only: <kbd>$2show=!minor</kbd>.

