	'messages:apihelp-query+usercontribs-param-tag' => 'en:Only list revisions tagged with this tag.',
	'messages:apihelp-query+usercontribs-param-toponly' => 'en:Only list changes which are the latest revision.',
	'messages:apihelp-query+usercontribs-example-user' => 'en:Show contributions of user <kbd>Example</kbd>.',
