	'messages:managewiki-header-extensions' => 'de:Du kannst die Erweiterungen und Skins dieses Wikis über dieses Panel verwalten. Dieses Panel zeigt alle verfügbaren Erweiterungen und Skins an. Wenn du die gewünschte Erweiterung oder den gewünschten Skin nicht findest, wende dich bitte an deinen Systemadministrator.

