	'messages:managewiki-header-extensions-view' => 'de:Du kannst die Erweiterungen und Skins dieses Wikis in diesem Bereich einsehen, verfügst jedoch nicht über die Berechtigung, sie zu verwalten. Wenn du eine Erweiterung oder einen Skin aktivieren möchtest, wende dich bitte an die Betreiber dieses Wikis.',
	'messages:managewiki-header-namespaces' => 'de:In diesem Bereich kannst du die Einstellungen für den Namensraum dieses Wikis verwalten. Einige Einstellungen werden erst übernommen, wenn du eine Erweiterung aktivierst. Weitere Informationen findest du in der MediaWiki-Dokumentation. Wenn du dies getan hast, klicke auf „Speichern“ und deine Einstellungen werden in wenigen Sekunden übernommen.',
	'messages:managewiki-header-namespaces-view' => 'de:Du kannst die Einstellungen für den Namensraum dieses Wikis in diesem Bereich einsehen, verfügst jedoch nicht über die Berechtigung, sie zu ändern. Wende dich an die Wiki-Betreiber, wenn du weitere Hilfe brauchst.',
	'messages:managewiki-header-permissions' => 'de:Hier kannst du die Einstellungen für die Benutzergruppen dieses Wikis verwalten (z. B. Berechtigungen, Gruppenzuweisungen und Autopromotion). Bitte lies die Dokumentation sorgfältig durch und lösche keine Gruppen voreilig, sonst könnte dein Wiki kaputtgehen. Wenn du das getan hast, klicke auf „Speichern“ und deine Einstellungen werden in wenigen Sekunden übernommen.

Nicht alle Berechtigungen können zugewiesen werden. Bestimmte Berechtigungen sind möglicherweise nur den Betreibern der Farm vorbehalten. Kontaktiere deine Farm, wenn du bestimmte Berechtigungen nicht findest.',
	'messages:managewiki-header-permissions-view' => 'de:Du kannst die Einstellungen der Benutzergruppen dieses Wikis (z. B. Berechtigungen, Gruppenzuweisungen und automatische Beförderungen) in diesem Bereich einsehen, verfügst jedoch nicht über die Berechtigung, sie zu ändern. Wende dich an die Wiki-Betreiber, wenn du weitere Hilfe brauchst.',
	'messages:managewiki-header-settings' => 'de:Du kannst die Einstellungen dieses Wikis (z. B. das Logo, das Design und mehr) in diesem Bereich festlegen. Sei vorsichtig! Lies dir die Beschreibungen der Einstellungen genau durch und schalte nicht wahllos Einstellungen um, wenn du nicht verstehst, was sie bewirken. Wenn du das getan hast, klicke auf „Speichern“ und deine Einstellungen werden in wenigen Sekunden übernommen. 

Ausgegraute Optionen können nur von den Betreibern der Farm geändert werden. Kerneinstellungen wie den Wiki-Namen und die Sprache kannst du unter [[Special:ManageWiki/core]] verwalten.',
	'messages:managewiki-header-settings-view' => 'de:Du kannst die Einstellungen dieses Wikis (z. B. das Logo, das Styling und mehr) in diesem Bereich einsehen, verfügst jedoch nicht über die Berechtigung, sie zu ändern.

